export const initialState = {
  postList: [],
  searchToggle: "none",
};

export const SEARCH_TOGGLE = "SEARCH_TOGGLE";

const reducer = (state = initialState, action) => {
  switch (action.type) {
    case SEARCH_TOGGLE:
      return {
        ...state,
        searchToggle: "none",
      };
    default:
      return state;
  }
};

export default reducer;
